import * as React from 'react';
import { AdvertiseMillionsCard } from '../functions/AdvertiseMillionsCard';

const quote = require('../../../../public/img/high/findteam-quote.jpg');

export const AdvertiseMillions = () => {
  return (
    <>
      <div className='w-full px-6 px-0 md:max-w-xl lg:max-w-5xl mx-auto pt-8 pb-16'>
        <div className='my-8'>
          <div className='mb-4 md:mb-0 flex md:justify-center'>
            <div
              style={{ width: 70, height: 2 }}
              className='bg-gray-650 rounded-lg'></div>
          </div>
        </div>
        <div className='w-full mx-auto lg:pt-32 pb-8 md:pb-16 flex flex-col md:flex-row'>
          <div className='w-full md:w-1/2'>
            <img className='h-full w-full' src={quote} />
          </div>
        </div>
      </div>
    </>
  );
};
